import { useEffect, useState } from "react";
import useScrollPosition from "@react-hook/window-scroll";
import Link from "next/link";

const NavbarMain = () => {
	const [scroll, setScroll] = useState(true);
	const scrollY = useScrollPosition(60);

	useEffect(() => {
		if (scrollY > 0) {
			setScroll(false);
		} else setScroll(true);
	}, [scrollY]);

	const navClass = "nav-main sticky-top navbar navbar-expand-lg navbar-dark ";

	return (
		<nav
			className={
				scroll
					? `${navClass} transition-ease`
					: `${navClass} nav-main-scroll transition-ease`
			}
		>
			<div className='container'>
				<Link href='/'>
					<a className={scroll ? "brand-display" : "navbar-brand p-2"} href='#'>
						<p className='brand-title-main'>Klinger</p>
					</a>
				</Link>

				<button
					className='navbar-toggler'
					type='button'
					data-toggle='collapse'
					data-target='#navbarTogglerDemo02'
					aria-controls='navbarTogglerDemo02'
					aria-expanded='false'
					aria-label='Toggle navigation'
				>
					<span className='navbar-toggler-icon'></span>
				</button>
				<div
					className='collapse navbar-collapse transition-ease  '
					id='navbarTogglerDemo02'
				>
					<ul className='navbar-nav mr-auto mt-2 mt-lg-0 transition-ease'>
						<li className='nav-item active '>
							<Link href='/'>
								<a className='nav-text'>
									Home <span className='sr-only'>(current)</span>
								</a>
							</Link>
						</li>
						<li className='nav-item '>
							<Link href='/praxis'>
								<a className='nav-text '>Praxis</a>
							</Link>
						</li>
						<li className='nav-item '>
							<Link href='/leistungen'>
								<a className='nav-text'>Leistungen</a>
							</Link>
						</li>
						<li className='nav-item '>
							<Link href='/adresse'>
								<a className='nav-text'>Kontakt</a>
							</Link>
						</li>
					</ul>
				</div>
			</div>
		</nav>
	);
};

export default NavbarMain;
